export default {
	name: 'sortchild',
	props: ['fruit'],
	computed: {
		pages() {
			const pages = [];
			Object.keys(this.fruit).forEach((item, index) => {
				const page = Math.floor(index / 3); //3代表3条为一行，随意更改
				if (!pages[page]) {
					pages[page] = [];
				}
				pages[page].push(this.fruit[item]);
			});
			return pages;
		}
	}
};
